import React from 'react';
import Auxiliary from '../../hoc/Auxiliary';
import Grid from '@material-ui/core/Grid';

const layout = (props) => {
	return (
		<Auxiliary>
            
			<div>Search Bar Component</div>
			<main>Main Content Area</main>
		</Auxiliary>
	);
};

export default layout;
